import React, { useState, useContext } from 'react';
import { Container, Form, Button, Row, Col } from 'react-bootstrap';
import { AppContext } from '../App';

const AddSales = () => {
  const { sales, setSales, Message } = useContext(AppContext);
  const [formData, setFormData] = useState({
    customer: '',
    plate: '',
    fs: '',
    quantities: { '8mm': 0, '10mm': 0, '12mm': 0, '14mm': 0, '16mm': 0, '20mm': 0, '24mm': 0, '32mm': 0 },
    date: new Date().toISOString().split('T')[0],
  });
const [message, setMessage] = useState("");
  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleQuantityChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      quantities: { ...formData.quantities, [name]: parseInt(value) || 0 },
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    setSales([...sales, { ...formData, id: Date.now(), shipped: false, shippedQuantities: {} }]);
    setAlertMessage('Registered thank you');
    // setMessage("✅ Registered-Thank you!");
    setTimeout(() => setAlertMessage(''), 3000);
    setFormData({
      customer: '',
      plate: '',
      fs: '',
      quantities: { '8mm': 0, '10mm': 0, '12mm': 0, '14mm': 0, '16mm': 0, '20mm': 0, '24mm': 0, '32mm': 0 },
      date: new Date().toISOString().split('T')[0],
    });
  };
 
 
  return (
    <Container className="mt-5">
      <h2 style={{marginLeft:'100px'}}>Add Sales</h2>
      {/* {alertMessage && <h3>{alertMessage}</h3>} */}
      {/* {message && <p style={{fontSize:'20px', marginTop:'0px'}} className="text-success">{message}</p>} */}
      <Form onSubmit={handleSubmit}>
        <Form.Group className="mb-3">
          <Form.Label style={{marginLeft:'100px'}}>Customer Name</Form.Label>
          <Form.Control style={{width:'50%',marginLeft:'100px'}} type="text" name="customer" value={formData.customer} onChange={handleChange} required />
        </Form.Group>
        <Form.Group className="mb-3">
          <Form.Label style={{marginLeft:'150px'}}>Plate Number</Form.Label>
          <Form.Control style={{width:'50%' ,marginLeft:'100px'}} type="text" name="plate" value={formData.plate} onChange={handleChange} required />
        </Form.Group>
        <Form.Group className="mb-3">
          <Form.Label style={{marginLeft:'100px'}}>FS Number</Form.Label>
          <Form.Control style={{width:'50%', marginLeft:'100px'}} type="text" name="fs" value={formData.fs} onChange={handleChange} required />
        </Form.Group>
        <Row>
          {Object.keys(formData.quantities).map((size) => (
            <Col md={3} key={size}>
              <Form.Group className="mb-3">
                <Form.Label>{size}</Form.Label>
                <Form.Control type="number" name={size} value={formData.quantities[size]} onChange={handleQuantityChange} min="0" />
              </Form.Group>
            </Col>
          ))}
        </Row>
        <Form.Group className="mb-3">
          <Form.Label>Date</Form.Label>
          <Form.Control type="date" name="date" value={formData.date} onChange={handleChange} required />
        </Form.Group>
        <Button variant="primary" type="submit">Submit</Button>
      </Form>
    </Container>
  );
};

export default AddSales;
